import { Marker } from '@react-google-maps/api'

export const MarkerQuery = ({ rest }) => {
  const { options } = rest

  console.log(options)

  return <Marker
    position={{ lat: Number(options.lat), lng: Number(options.lng) }}
    
  />
}
